public class JArray {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		String [] jay = {"Joe", "Jack", "Jake"};

			
		for (int i = jay.length-1; i >= 0; i--){
			
			System.out.print(jay[i] + " " ); 
			
				
		}//for loop
		
	}
		

}